import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import HomePage from './Home.js';



class Main extends Component {
    render() {
        return (
            <div>
                <Route exact path="/" component={HomePage} />
            </div>
        );
    }
}
export default Main;
